function redirectToView(e){window.location="https://"+window.location.host+e}$(document).ready(function(){$.ajax({url:"https://checkexames.herokuapp.com/select_all_exames",success:function(e){e.forEach(e=>{document.getElementById("report-div").innerHTML+="<h2>"+e.nome+"</h2>",Object.keys(e).forEach(o=>{e[o]&&"id"!=o&&"nome"!=o&&(document.getElementById("report-div").innerHTML+="<p>"+o+"<p>")})})}})});